    false,nt"url": null,nt"notes": "NODC Accession 0108094 includes chemical,
    meteorological, physical and underway - surface data collected from NOAA Ship RONALD
    H. BROWN in the Caribbean Sea, North Atlantic Ocean and South Atlantic Ocean from
    2011-07-22 to 2011-12-06 and retrieved during cruise RB-11-01, RB-11-02, RB-11-03
    and RB-11-04. These data include BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR, CARBON
    DIOXIDE - PARTIAL PRESSURE - DIFFERENCE, Partial pressure (or fugacity) of carbon
    dioxide, SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect these
    data include Carbon dioxide (CO2) gas analyzer and Shower head chamber equilibrator
    for autonomous carbon dioxide (CO2) measurement. These data were collected by Rik
    Wanninkhof of US DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological Laboratory
    as part of the R/V Ronald Brown 2011 Underway Data data set.nnThe Global Volunteer
    Observing Ship (VOS) Program is coordinated by the UNESCO International Ocean Carbon
    Coordination Project (IOCCP). International groups from 14 countries have been outfitting
    research ships and commercial vessels with automated CO2 sampling equipment to analyze
    the carbon exchange between the ocean and atmosphere.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
